import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import UserList from '../src/components/usersList';


function App() {
  return (
    <Router>
      <div>
        <h1>Users Management</h1>
        <Switch>
          <Route exact path="/" component={UserList} />


        </Switch>
      </div>
    </Router>
  );
}

export default App;
